import React from "react";
import { Link, Redirect } from "react-router-dom";
import "./style.css";
function Button(props) {
  return (
    <Link to="/api/showdata" className="row">
      <button id="towch" className="button" onClick={towchdarah}>
        <span>{props.txt}</span>
      </button>
    </Link>
  );
}
Button.defaultProps = {
  txt: "Submit",
};
function towchdarah() {
  if (document.getElementById("towch").innerHTML == "Back") {
    Redirect("http://localhost:3006/");
  } else {
    var a = document.getElementById("1").value;
    var b = document.getElementById("2").value;
    console.log(a);
    if ((a == null || a == "", b == null || b == "")) {
      alert("Please Fill All Required Field");
    } else {
      // window.open("https://m.egolomt.mn/billingtest/cardinfo.aspx");
    }
  }
}

export default Button;
